import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
    main: {
        // maxWidth: 345, original width style
        marginTop: "10rem",
        maxWidth: '100%',
        color: 'black',
        marginLeft: '41%'
    }
}));
